import React, { useContext } from "react";
import styles from "./Header.module.scss";
import { useState } from "react";
import MobileMenu from "./components/MobileMenu";
import { Link } from "react-router-dom";
import { AuthContext } from "../../context";
import logo from "../../assets/png/logo.png";

export default function Header() {
  const {
    userGoogle,
    user,
    signout,
    signoutGoogle,
    userFacebook,
    signoutFacebook,
  } = useContext(AuthContext);
  const [showMenu, setShowMenu] = useState(false);
  const [count, setCount] = useState(0);

  function addCount() {
    setCount(count + 1);
  }
  function handleClick() {
    if (count === 0) {
      setShowMenu(true);
      addCount();
    } else {
      setShowMenu(false);
      setCount(0);
    }
  }

  let userPictureUrl = "";

  if (Object.keys(userGoogle).length !== 0) {
    // Utilisateur connecté avec Google
    userPictureUrl = userGoogle.picture;
  } else if (Object.keys(userFacebook).length !== 0) {
    // Utilisateur connecté avec Facebook
    userPictureUrl = userFacebook.picture.data.url;
  }

  return (
    <header className={`${styles.header}`}>
    <div className="container-fluid">
      <ul className={`${styles.desktopHeader} row`}>
        {user ||
        (userGoogle && Object.keys(userGoogle).length !== 0) ||
        (userFacebook && Object.keys(userFacebook).length !== 0) ? (
          <>
            <div className="col-3">
              <p>
                Bienvenue {""}
                {userGoogle.name || userFacebook.name || user[0].pseudo}
              </p>
            </div>

            <li className="col-3">
              <Link to="/">
                <button className="btn btn-primary las la-home">
                  <span>Accueil</span>
                </button>
              </Link>
            </li>
            
            {user && (
              <li>
                <Link onClick={() => signout()}>
                  <button className="btn btn-primary-reverse ml-1 las la-sign-out-alt">
                    <span className={`${styles.te}`}>Déconnexion</span>
                  </button>
                </Link>
              </li>
            )}
            {userGoogle && Object.keys(userGoogle).length !== 0 && (
              <li>
                <Link onClick={() => signoutGoogle()}>
                  <button className="btn btn-primary-reverse ml-1 las la-sign-out-alt">
                    <span className={`${styles.te}`}>Déconnexion</span>
                  </button>
                </Link>
              </li>
            )}
            {userFacebook && Object.keys(userFacebook).length !== 0 && (
              <li>
                <Link onClick={() => signoutFacebook()}>
                  <button className="btn btn-primary-reverse ml-1 las la-sign-out-alt">
                    <span className={`${styles.te}`}>Déconnexion</span>
                  </button>
                </Link>
              </li>
            )}
          </>
        ) : (
          <li>
            <Link to="/signin">
              <button type="button" className="mr-1 btn btn-primary">
                <i className="fas fa-right-to-bracket mr-1"></i>
                <span>Connexion</span>
              </button>
            </Link>
          </li>
        )}
      </ul>
      <i
        onClick={handleClick}
        className={`las la-bars mr-1 position-fixed`}
      ></i>
      {showMenu&& (
          <>
            <MobileMenu />
          </>
        )}
        <div className={`${styles.pos}`}>
          <img src={userPictureUrl} alt="avatar utilisateur"></img>
        </div>
      </div>

      <img src={logo} alt="logo 20 minutes" className=""></img>
    </header>
  );
}
